import React from "react";
import {
  Box,
  Button,
  Card,
  CardContent,
  CardMedia,
  CardActions,
  Chip,
  Typography,
} from "@mui/material";
import { LocationOnIcon, PhoneIcon } from "@mui/icons-material";

const PlaceDetails = ({ place }) => {
  return (
    /**<h1>{place.name}</h1>**/
    <Card elevation={6}>
      <CardMedia
        style={{ height: 350 }}
        image={
          place.photo
            ? place.photo.images.large.url
            : "https://900degreespizza.com/placeholder-image-6/"
        }
        title={place.name}
      ></CardMedia>
      <CardContent>
        <Typography gutterBottom varient="h5"> {place.name}</Typography>
        <Box display="flex" justifyContent="space-between">
          <Typography varient="su">{place.name}</Typography>
          <Typography>{place.name}</Typography>

        </Box>
        </CardContent>
    </Card>
  );
};
export default PlaceDetails;
